CREATE TABLE pg_elong (
	pg_elong_id			serial primary key,
	MAT_NO				varchar(100),
	SURNAME				varchar(100),
	FIRST_NAME			varchar(100),
	OTHER_NAME			varchar(100),
	DEGREE				varchar(100),
	COURSE				varchar(100),
	SPECIALIZATION		varchar(100),
	B_ACCT				varchar(100),
	MODULE				varchar(100)
);




UPDATE pg_elong SET MAT_NO = trim(upper(MAT_NO)), DEGREE = trim(upper(DEGREE)), MODULE = trim(upper(MODULE));




